css:
atom-workspace.theme-one-dark-ui atom-panel-container.tab-switcher,
atom-workspace.theme-one-light-ui atom-panel-container.tab-switcher {
  position: static;
}
atom-panel.modal.tab-switcher {
  position: absolute;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  width: 100%;
  height: 100%;
  display: flex;
  flex-direction: row;
  justify-content: center;
  margin: auto;
  padding: 0;
  border: 0;
  background-color: transparent;
  opacity: 0;
}
atom-panel.modal.tab-switcher.is-visible {
  opacity: 1;
}
atom-panel.modal.tab-switcher::before {
  background-color: transparent;
}
atom-panel.modal.tab-switcher .vertical-axis {
  display: flex;
  flex-direction: column;
  justify-content: center;
}
ol.tab-switcher-tab-list {
  max-height: 100%;
  overflow: hidden;
  display: inline-block;
  margin: 0;
  padding: 0.5em 0;
  text-align: left;
  list-style: none;
  background-color: rgba(32, 33, 35, 0.7);
  border-radius: 1em;
  font-size: 150%;
  color: white;
}
ol.tab-switcher-tab-list li {
  display: flex;
}
ol.tab-switcher-tab-list li.current {
  background: linear-gradient(to bottom, #105db8, #3380db);
  border-top: solid 1px white;
  border-bottom: solid 1px white;
  color: white;
}
ol.tab-switcher-tab-list li:not(.current) {
  border-top: solid 1px transparent;
  border-bottom: solid 1px transparent;
}
ol.tab-switcher-tab-list .icon {
  margin: 0 0.5em;
}
ol.tab-switcher-tab-list .tab-sublabel {
  font-size: 75%;
  color: #d4d4d4;
  margin: 0 1em;
}
ol.tab-switcher-tab-list .tab-label.modified::before {
  margin-right: 0.2em;
  font-weight: bold;
  color: #0098ff;
  content: '\26ac';
}
